  const onClick = () => {
    console.log("click")
    setValue((prev) => prev + 1)
  };
  return (
    <div>
      <h1 className={styles.title}>{counter}</h1>
      <button text={""} onClick={onClick} />
    </div>
  );
}

export default App;
